  \"Temperature, conductivity, and water currents data collected by CTDs and current
  meters on moored buoys in the Sermilik Fjord, Greenland from 2011-08-20 to 2012-09-16
  (NODC Accession 0126772)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-02-26T22:15:57.972633\",\n\t\"name\": \"temperature-conductivity-and-water-currents-data-collected-by-ctds-and-current-meters-on-m\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The data included in this dataset were
  collected in the Sermilik Fjord, located in East Greenland in the Ammassalik district
  close to the town of Tasiilaq. Data collection was conducted by deploying six moorings
  from August 2011 to September 2012. The seven moorings were named CM1SF5, CM2SF6,
  OE1, OW1, SF1, SF3, and SF4. Mooring CM1SF5 was located mid-fjord at a depth of
  129 meters and was equipped with an SBE MicroCAT. Mooring CM2SF6 was located next
  to CM1SF5 at a depth of 265 meters. It was equipped with an SBE MicroCAT. Two moorings
  were positioned outside the fjord, OE1 was located on the east side of the fjord
  entrance at a depth of 255 meters and OW1 was located on the west side at a depth
  of 252 meters. Mooring OE1 was equipped with an RBR DR-150 Depth Recorder, five
  Onset UTBI-001 TidbiT Temperature Loggers, and an RBR XR-420 CTD. Mooring OW1 was
  outfitted with only an SBE MicroCAT. Mooring SF1 was located at the north end of
  the fjord at a depth of 630 meters. Data recovered from this mooring included three
  SBE MicroCAT and an RDI ADCP. Mooring SF3 was positioned near the glacier at a depth
  of 15 meters and was outfitted with an SBE MicroCAT and an Onset UTBI-001 Tidbit
  Temperature Logger. Mooring SF4 was positioned in the middle of the fjord at a depth
  of 860 meters. Data collected from this mooring included two RBR XR-420s, five Onset
  UTBI-001 Temperature Loggers, one SBE MicroCAT, and an RDI ADCP.\",\n\t\"license_title\":
